import React from 'react'

class FilterButton extends React.Component {

    buttonSelect = (e) => {
        this.props.buttonSelect(this.props.cat)
    }

    render() {
        return (
        <button onClick={this.buttonSelect}>{this.props.cat}</button>
        )
    }
}

export default FilterButton
